import { useState, useEffect } from "react";

function App(params) {

  const [loading, setloading] = userState(true);
  userEffect(()=>{
    fetch(
      `https://yts.mx/api/v2/list_movies.json?minimum_rating=8.8&sort_by=year`
      ).then(response => response.json()).then(json => console.log(json));
  },[])
}

export default App;
